import React, { Component } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

const Customer = props => (
    <tr>
        <td>{props.todo.cust_name}</td>
        <td>{props.todo.cust_age}</td>
        <td>{props.todo.cust_id}</td>
    </tr>
)
export default class OtherPage extends  Component {
    constructor(props){
        super(props);
        this.state = {customers: []};
    }

    componentDidMount() {
        axios.get('http://localhost:4000/customers/')
            .then(response => {
                this.setState({ customers: response.data });
            })
            .catch(function (error){
                console.log(error);
            }   )
    }

    todoList() {
        return this.state.customers.map(function(currentCust, i){
            // return <Customer customer={currentCust} key={i} />;
            const {name, age, id} = currentCust;

            return (
                <tr key = {id}>
                    <td>{name}</td>
                    <td>{age}</td>
                    <td>{id}</td>
                </tr>
            )
        })
    }
    render(){
        return (
            <div>
                <h3>Customers List</h3>
                <table className="table table-striped" style={{ marginTop: 20 }} >
                    <thead>
                        <tr>
                            <th>Name</th>
                            <th>Age</th>
                            <th>ID</th>
                        </tr>
                    </thead>
                    <tbody>
                        { this.todoList() }
                    </tbody>
                </table>
            </div>
        );
    }
}
